'''東方幻想界_-桜々夢ノ音-'''是由[[狐之工作室]]制作并发行的东方同人专辑，该专辑首次发行于2010年10月11日的第六届 東方紅楼夢上，场贩售价为500日元，通贩售价为525日元
==介绍==
作为狐之工作室的第四部系列专辑，这部专辑一反常态，相对较多的采用了钢琴为主的曲风，辅以多种乐器独奏。这部专辑相对来说更注重了打击乐器的使用，曲风也从一贯的宏大悠扬转为了清幽宁静。该专辑的原曲均来自[[东方妖妖梦]]，也与专辑名字所呼应
